        var output, elt, level;
        var getByName = function(name) {
            var list = output;
            var foundElt;
            if (list) {
                var eltI;
                for (var i = 0; !foundElt && (i < list.length); i++) {
                    eltI = list[i];
                    if (eltI.name == name) {
                        foundElt = eltI;
                    }
                }
            }
            return foundElt;
        }
        var doIt = function(node) {
            if (condition) {
                var conditionResult = condition(node);
                if (!conditionResult) return;
            }

            if (!output) {
                output = [];
            }
            elt = getByName(node.name);
            if (!elt) {
                elt = {};
                elt.value = 0;
                output.push(elt);
            }
            elt.value += node.rawNode[prop];
            elt.name = node.name;
            elt.unit = unit;

